- input: "TEXT\x1CC00167213\x1C.TEXT\x1C\x1CF3XA\x1CTHIS AMENDED REPORT IS SUBMITTED
    IN RESPONSE TO THE FEDERAL ELECTION COMMISSION LETTER DATED 11-18-09.  THIS AMENDED
    REPORT CORRECTS THE ADMINISTRATIVE CATEGORY RATIO FOR THE SCHEDULE H4, ON SCHEDULE
    H1.  THE CORRECT RATIO IS 21%.                                           The 2nd
    amended report is submitted in response to the FEC Letter Dated 1-27-10.  This
    report provides additional information on the H2 schedule.  In January the Federal
    % of the Direct Mail fundraising activity was changed from 75% to 85%.  This was
    the result of a Direct Mail mailing that went out on January 13, 2009 and was
    titled First Renewal 2009.  Experience reflected that 85% of funds raised would
    go into the Federal Account, therefore the reason for the change.\n"
